import React from 'react';
import { useSelector } from 'react-redux';

import './FinishPage.css';
import { Button } from 'antd';
import { State } from '../reducers';

function FinishPage() {
  const result = useSelector((state:State) => state.result);

  return (
    <div className="falcon-finish-main">
      <div className="row">
        <div className="col">
          <h5>{result.status}</h5>
          {
                result.status === 'success' ? (
                  <div>
                    <h4>Congratulations on finding falcone.King Shan is mightly pleased</h4>
                    {' '}
                    <h5>
                      PLANET FOUND:
                      {result.planet_name}
                    </h5>
                  </div>
                ) : (
                  <h6>
                    So Sorry
                    {' '}
                    {result.error}
                  </h6>
                )
            }
          <Button type="primary">START AGAIN</Button>


        </div>
      </div>

    </div>
  );
}
export default FinishPage;
